import React, { useState } from "react";
import LabelStyle1 from "../components/custom controls/labels/LabelStyle1"
import TextBoxStyle2 from "../components/custom controls/textBox/TextBoxStyle2";
import ButtonStyle1 from "../components/custom controls/buttons/ButtonStyle1"
import GoogleIcon from "../Images/GoogleIcon.png"
import Login_SingUp_bg from "../Images/Login_SingUp_bg.png"

export default function SingUp(){
    const SingUpButtonHandled =()=> {
        alert("wsh moooooh!");
    }

    const handleChange = (e) => {
        const { name, value } = e.target;
        setSingUpFormData((prevData) => ({
            ...prevData,
            [name]: value
        }));
    };

    const [loginFormData,setSingUpFormData] = useState({
        email:'',
        password:''
    });
    return(

        
            <div className="flex flex-col items-center">
                        <LabelStyle1 labelText="Sing up" labelClassName="mt-5 text-3xl justify-self-center mb-5"/>
                        <form className="bg-white flex flex-col mb-5 w-[95%]">
                    <div className="flex mb-2">
                <LabelStyle1 labelText="First Name :" labelClassName="text-sm mr-1 whitespace-nowrap"/>
                <TextBoxStyle2 Name='firstname' placeholder="first name" value={loginFormData.firstname} onChange={handleChange} textBoxClassName="w-[40%]"/>
                <LabelStyle1 labelText="Last Name : " labelClassName="text-sm mr-1 whitespace-nowrap"/>
                <TextBoxStyle2 Name='lastname' placeholder="last name" value={loginFormData.lastname} onChange={handleChange} textBoxClassName="w-full"/>
                    </div>
                <LabelStyle1 labelText="Matrecule :" labelClassName="text-md mb-1"/>
                <TextBoxStyle2 Name='matrecule' placeholder="your Matrecule" value={loginFormData.matrecule} onChange={handleChange} textBoxClassName="w-[90%] mb-2"/>
                <LabelStyle1 labelText="Email:" labelClassName="text-md"/>
                <TextBoxStyle2 Name='email' textBoxtype='email' placeholder="Example@gmail.com" value={loginFormData.email} onChange={handleChange} textBoxClassName="w-[90%] mb-2"/>
                    
                <LabelStyle1 labelText="Password:" labelClassName="text-md mt-1"/>
                <TextBoxStyle2 Name='password' textBoxtype='password' placeholder="password" value={loginFormData.password} onChange={handleChange} textBoxClassName="w-[90%] mb-2"/>
                
                <ButtonStyle1 buttonText="Sing-UP" buttonClassName="mt-5" onClick={SingUpButtonHandled}/>
                <div className="relative mt-8">
                    <h5 className="absolute left-1/2 transform -translate-x-1/2 top-[-12px] bg-white px-2">OR</h5>
                    <hr className="border border-gray-500" />
                </div>
                <button className={`text-gray-500 rounded-[5px] p-2 text-[12px] font-Cairo bg-white shadow-md mt-8`}>
                <div className="flex justify-center">
                            <img src={GoogleIcon} alt="Button Icon" className="w-4 h-4 mr-2 mt-[1px]"/>
                            Sing with Google
                        </div>
                </button>
                
                </form>
                
            </div>
    );

}
